import React,{useState,useEffect} from 'react';
import logo from './logo.svg';
import './App.css';

function List(props) {
  const[data, setData] = useState([])

  useEffect(()=>{
    setData(props)
  },[props])

  console.log(data);
  return (
    <div className="">
      {props.picture}
    </div>
  );
}

export default List;
